import React from 'react'
import './SliderShape.css'

function SliderShape() {
    return (
        <div class="slider-shape">
            <img class="shape-1 animation-round" src="/images/shape/shape-8.png" alt="Shape" />
        </div>
    )
}

export default SliderShape
